import React from "react";
import "../../../Styles/Pages/Blog/BlogHeader.scss";

function BlogHeader() {
  return (
    <div className='blogHeader'>
      <div className='title'>
        <h1>BLOG</h1>
      </div>
    </div>
  );
}

export default BlogHeader;
